import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <div>
        <h3>Moemen Elgammal</h3>
      </div>
      <nav>
        <ul>
          <li>
            <Link to='/about'>about</Link>
          </li>
          <li>
            <Link to='/portfolio'>Portfolio</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
